import React from "react";
import ReactDOM from "react-dom";
import { ChakraProvider } from "@chakra-ui/react";
import { BrowserRouter } from "react-router-dom";
import theme from "./theme";
import { Provider } from "react-redux";
import { store } from "./store/store";
import MainRoutes from "./components/MainRoutes";

ReactDOM.render(
	<React.StrictMode>
		<Provider store={store}>
			<ChakraProvider theme={theme}>
				<BrowserRouter>
					<MainRoutes />
				</BrowserRouter>
			</ChakraProvider>
		</Provider>
	</React.StrictMode>,
	document.getElementById("root")
);

import { extendTheme, ThemeConfig } from "@chakra-ui/react";

const config: ThemeConfig = {
	initialColorMode: "light",
	useSystemColorMode: false,
};

const theme = extendTheme({ config });

export default theme;

import { request, gql } from "graphql-request";
import { Pokemon } from "../types/pokemon";

const API_URL = "http://localhost:3001/pokemon-api";

const pokemonFindManyQuery = (query: string = "") => gql`
	{
		pokemonMany(filter: {nameRegex: "${query}"}, sort: _ID_ASC) {
			id,
			name,
			type,
			img
		}
	}
`;

export const fetchPokemonListService = (query: string = "") =>
	request(API_URL, pokemonFindManyQuery(query)).then((res) => ({
		data: res?.pokemonMany,
	}));

const pokemonFindOneQuery = (pokemonId: Pokemon["id"]) => gql`
	{
		pokemonOne(filter: {id: ${pokemonId}}) {
			id,
			name,
			img,
			nickname,
			moves { 
				level { 
					learnedat, 
					name 
				} 
			},
			damages {
				normal,
				fire,
				water,
				electric,
				grass,
				ice,
				fight,
				poison,
				ground,
				flying,
				psychic,
				bug,
				rock,
				ghost,
				dragon,
				dark,
				steel,
			},
			stats {
				hp,
				attack,
				defense,
				spattack,
				spdefense,
				speed,
			},
			misc {
				abilities {
					normal,
					hidden
				},
				classification,
				height,
				weight,
			},
			type
		}
	}
`;

export const fetchPokemonService = (pokemonId: Pokemon["id"]) =>
	request(API_URL, pokemonFindOneQuery(pokemonId)).then((res) => ({
		data: res?.pokemonOne,
	}));

import { Flex, Heading } from "@chakra-ui/react";
import { FC } from "react";
import { Outlet } from "react-router-dom";

const App: FC = () => (
	<Flex
		className="App"
		h="100%"
		flexDirection="column"
		justify="space-between"
	>
		<Heading
			boxShadow="lg"
			p={4}
			mb={4}
			backgroundColor="#41AED9"
			color="#F2EB88"
			textShadow="5px 5px 0px #2C7BBF"
		>
			Pok√©Search
		</Heading>
		<Flex p={4}>
			<Outlet />
		</Flex>
	</Flex>
);

export default App;

import { Flex, Heading } from "@chakra-ui/react";
import { FC } from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import App from "./App";
import PokemonDetails from "./PokemonDetails";
import SearchBar from "./SearchBar";
import SearchResults from "./SearchResults";

const MainRoutes: FC = () => (
	<Routes>
		<Route path="/pokemon" element={<App />}>
			<Route
				index
				element={
					<Flex flexDir="column" flexGrow="1">
						<SearchBar />
						<SearchResults />
					</Flex>
				}
			/>
			<Route path=":pokemonId" element={<PokemonDetails />} />
		</Route>
		<Route path="*" element={<Navigate to="/pokemon" />} />
	</Routes>
);

export default MainRoutes;

import startCase from "lodash.startcase";
import { ArrowBackIcon, ArrowForwardIcon, SearchIcon } from "@chakra-ui/icons";
import {
	HStack,
	Button,
	Flex,
	Heading,
	Image,
	StackDivider,
	VStack,
	Text,
	SimpleGrid,
	Stat,
	StatLabel,
	StatNumber,
} from "@chakra-ui/react";
import { FC, useEffect } from "react";
import { useParams } from "react-router";
import { fetchPokemon } from "../store/detailsSlice";
import { useAppDispatch, useAppSelector } from "../store/hooks";
import { selectSelectedPokemon } from "../store/selectors";
import {
	PokemonDamages,
	PokemonMisc,
	PokemonMoves,
	PokemonStats,
	PokemonType,
} from "../types/pokemon";
import { useNavigate } from "react-router-dom";

interface GeneralPokemonDataOwnProps {
	readonly children?: React.ReactNode;
	readonly keyValueMap?: PokemonDamages | PokemonStats;
	readonly title: string;
}

const GeneralPokemonDataComp: FC<GeneralPokemonDataOwnProps> = ({
	children,
	keyValueMap,
	title,
}) => (
	<Flex direction="column" w="100%" mb="3rem">
		<Heading size="lg">{title}</Heading>
		<VStack
			mt="1rem"
			divider={<StackDivider borderColor="gray.200" />}
			spacing={2}
			align="stretch"
		>
			{children ||
				(keyValueMap &&
					Object.entries(keyValueMap).map(([key, value]) => (
						<Flex key={`${key}-${value}`}>
							<Text>
								<strong>{key.toUpperCase()}</strong>
							</Text>
							<Text ml="0.5rem">{value}</Text>
						</Flex>
					)))}
		</VStack>
	</Flex>
);

const PokemonMovesComp: FC<{ moves: PokemonMoves["level"] }> = ({ moves }) => (
	<GeneralPokemonDataComp title="Moves">
		{moves.map(({ learnedat, name }) => (
			<Flex align="center" key={`${name}-${learnedat}`}>
				<Text>
					<strong>{startCase(name)}</strong>
				</Text>
				<Text as="sub" ml="1rem">
					(
					{learnedat
						? `Learned at level: ${learnedat}`
						: "From the start"}
					)
				</Text>
			</Flex>
		))}
	</GeneralPokemonDataComp>
);

const PokemonTypeComp: FC<{ types: PokemonType[] }> = ({ types }) => (
	<Flex direction="column" align="center" mb="2rem">
		<Text fontSize="1.5rem">Type(s)</Text>
		<HStack divider={<StackDivider borderColor="gray.200" />}>
			{types.map((type) => (
				<Text key={type}>{type}</Text>
			))}
		</HStack>
	</Flex>
);

const PokemonMiscComp: FC<{ misc: PokemonMisc }> = ({ misc }) => (
	<SimpleGrid columns={3} spacing={10} mb="3rem">
		<Stat direction="column">
			<StatLabel>Normal Abilities</StatLabel>
			<HStack divider={<StackDivider borderColor="gray.200" />}>
				{misc.abilities.normal.map((ability: string) => (
					<Text key={ability}>{ability}</Text>
				))}
			</HStack>
		</Stat>
		<Stat direction="column">
			<StatLabel>Hidden Abilities</StatLabel>
			<HStack divider={<StackDivider borderColor="gray.200" />}>
				{misc.abilities.hidden.map((ability: string) => (
					<Text key={ability}>{ability}</Text>
				))}
			</HStack>
		</Stat>
		<Stat direction="column">
			<StatLabel>Classification</StatLabel>
			<Text>{startCase(misc.classification)}</Text>
		</Stat>
		<Stat direction="column">
			<StatLabel>Height (ft,in)</StatLabel>
			<StatNumber>{misc.height}</StatNumber>
		</Stat>
		<Stat direction="column">
			<StatLabel>Weight (lbs)</StatLabel>
			<StatNumber>{misc.weight}</StatNumber>
		</Stat>
	</SimpleGrid>
);

const PokemonDetails: FC = () => {
	const { pokemonId } = useParams();
	const dispatch = useAppDispatch();
	const navigate = useNavigate();
	const selectedPokemon = useAppSelector(selectSelectedPokemon);

	useEffect(() => {
		const routePokemonId = pokemonId && parseInt(pokemonId, 10);
		const isNewRoutePokemonId = selectedPokemon?.id != routePokemonId;
		const isPokemonNotLoaded = !selectedPokemon;

		if (routePokemonId && (isNewRoutePokemonId || isPokemonNotLoaded)) {
			dispatch(fetchPokemon(routePokemonId));
		}
	}, [pokemonId]);

	if (!selectedPokemon) {
		return null;
	}

	const handlePreviousClick = () => {
		const previousPokemonId =
			selectedPokemon.id == 1 ? 151 : selectedPokemon.id - 1;
		navigate(`../${previousPokemonId}`, { replace: true });
	};

	const handleNextClick = () => {
		const nextPokemonId =
			selectedPokemon.id == 151 ? 1 : selectedPokemon.id + 1;
		navigate(`../${nextPokemonId}`, { replace: true });
	};

	const handleBackToSearchClick = () => navigate(`..`, { replace: true });

	return (
		<Flex flexDir="column" alignItems="center" flex="1">
			<Flex w="100%" justify="space-between">
				<Button
					leftIcon={<ArrowBackIcon />}
					onClick={handlePreviousClick}
				>
					Previous
				</Button>
				<Button
					rightIcon={<SearchIcon />}
					onClick={handleBackToSearchClick}
				>
					Back to search
				</Button>
				<Button
					rightIcon={<ArrowForwardIcon />}
					onClick={handleNextClick}
				>
					Next
				</Button>
			</Flex>
			<Heading mt="3rem">
				{selectedPokemon.name} #{selectedPokemon.id}
			</Heading>
			<Image
				my="3rem"
				src={selectedPokemon.img}
				alt={selectedPokemon.name}
				objectFit="contain"
			/>
			<PokemonTypeComp types={selectedPokemon.type} />
			<PokemonMiscComp misc={selectedPokemon.misc} />
			<GeneralPokemonDataComp
				title="Stats"
				keyValueMap={selectedPokemon.stats}
			/>
			<GeneralPokemonDataComp
				title="Damage Multipliers"
				keyValueMap={selectedPokemon.damages}
			/>
			<PokemonMovesComp moves={selectedPokemon.moves.level} />
		</Flex>
	);
};

export default PokemonDetails;

import { useNavigate } from "react-router-dom";
import {
	Flex,
	Text,
	Image,
	Heading,
	WrapItem,
	AspectRatio,
} from "@chakra-ui/react";
import { FC } from "react";
import { Pokemon } from "../types/pokemon";
import { useAppDispatch } from "../store/hooks";
import { setSelectedPokemons } from "../store/detailsSlice";

interface PokemonListItemOwnProps {
	readonly pokemon: Pokemon;
}

const getTypeList = (type: string, index: number, list: string[]) =>
	`${type}${list.length > 1 && index < list.length - 1 ? ", " : ""}`;

const PokemonListItem: FC<PokemonListItemOwnProps> = ({ pokemon }) => {
	const navigate = useNavigate();
	const dispatch = useAppDispatch();

	const handleOnClick = async () => {
		await dispatch(setSelectedPokemons(pokemon));
		navigate(`${pokemon.id}`, { replace: true });
	};

	return (
		<WrapItem
			p="1rem"
			mb="0.5rem"
			borderRadius="5px"
			boxShadow="lg"
			flexDirection="column"
			cursor="pointer"
			onClick={handleOnClick}
			flexDir="column"
			alignItems="center"
			justifyContent="space-between"
		>
			<Flex justifyContent="center" h="100%" maxWidth="128px">
				<Image
					src={pokemon.img}
					alt={pokemon.name}
					objectFit="contain"
				/>
			</Flex>
			<Flex flexDir="column" alignItems="center">
				<Heading size="sm" mt="0.5rem">
					{pokemon.name} #{pokemon.id}
				</Heading>
				<Text fontSize="xs">Types: </Text>
				<Text fontSize="xs">{pokemon.type.map(getTypeList)}</Text>
			</Flex>
		</WrapItem>
	);
};

export default PokemonListItem;

import { Search2Icon } from "@chakra-ui/icons";
import {
	Flex,
	IconButton,
	Input,
	InputGroup,
	InputRightElement,
} from "@chakra-ui/react";
import { FC } from "react";
import { useForm } from "react-hook-form";
import { useAppDispatch } from "../store/hooks";
import { fetchPokemonList } from "../store/listSlice";

const searchFieldName = "searchQuery";

interface PokemonSearchFormType {
	[searchFieldName]: string;
}

const SearchBar: FC = () => {
	const dispatch = useAppDispatch();
	const { register, handleSubmit } = useForm();

	const onSearchSubmit = (data: PokemonSearchFormType) => {
		console.log(data);
		dispatch(fetchPokemonList(data?.[searchFieldName]));
	};

	return (
		<Flex justify="center">
			<form onSubmit={handleSubmit(onSearchSubmit)}>
				<InputGroup size="md">
					<Input
						pl={2}
						pr="3rem"
						size="lg"
						placeholder="Search for a Pok√©mon..."
						{...register(searchFieldName)}
						variant="flushed"
					/>
					<InputRightElement>
						<IconButton
							type="submit"
							aria-label="Search for a specific Pok√©mon"
							icon={<Search2Icon color="grey" />}
							variant="ghost"
						/>
					</InputRightElement>
				</InputGroup>
			</form>
		</Flex>
	);
};

export default SearchBar;

import { Flex, Text, Divider, Wrap, Center } from "@chakra-ui/react";
import { FC, useEffect } from "react";
import { useAppDispatch, useAppSelector } from "../store/hooks";
import { fetchPokemonList } from "../store/listSlice";
import { selectPokemonList } from "../store/selectors";
import PokemonListItem from "./PokemonListItem";

const SearchResults: FC = () => {
	const dispatch = useAppDispatch();
	const pokemonList = useAppSelector(selectPokemonList);

	useEffect(() => {
		dispatch(fetchPokemonList());
	}, []);

	return (
		<Wrap mt="2rem" justify="center" spacing="0.5rem">
			{pokemonList.map((pokemon) => (
				<PokemonListItem key={pokemon.id} pokemon={pokemon} />
			))}
		</Wrap>
	);
};

export default SearchResults;

import { createAsyncThunk, createSlice, PayloadAction } from "@reduxjs/toolkit";
import { fetchPokemonService } from "../api/graphql";
import { Pokemon } from "../types/pokemon";

export const fetchPokemon = createAsyncThunk(
	"list/fetchPokemon",
	async (pokemonId: Pokemon["id"]) => {
		const response = await fetchPokemonService(pokemonId);
		return (await response.data) as Pokemon;
	}
);

interface DetailsState {
	readonly selected?: Pokemon;
}

const initialState: DetailsState = {};

export const detailsSlice = createSlice({
	name: "details",
	initialState,
	reducers: {
		setSelectedPokemons: (state, action: PayloadAction<Pokemon>) => {
			state.selected = action.payload;
		},
	},
	extraReducers: (builder) => {
		builder.addCase(fetchPokemon.fulfilled, (state, action) => {
			state.selected = action.payload;
		});
	},
});

export const { setSelectedPokemons } = detailsSlice.actions;

export default detailsSlice.reducer;

import { TypedUseSelectorHook, useDispatch, useSelector } from "react-redux";
import type { RootState, AppDispatch } from "./store";

export const useAppDispatch = () => useDispatch<AppDispatch>();
export const useAppSelector: TypedUseSelectorHook<RootState> = useSelector;

import { createAsyncThunk, createSlice } from "@reduxjs/toolkit";
import { fetchPokemonListService } from "../api/graphql";
import { Pokemon } from "../types/pokemon";

export const fetchPokemonList = createAsyncThunk(
	"list/fetchPokemonList",
	async (query?: string) => {
		const response = await fetchPokemonListService(query);
		return (await response.data) as Pokemon[];
	}
);

interface ListState {
	results: Pokemon[];
}

const initialState: ListState = {
	results: [],
};

export const listSlice = createSlice({
	name: "list",
	initialState,
	reducers: {},
	extraReducers: (builder) => {
		builder.addCase(fetchPokemonList.fulfilled, (state, action) => {
			state.results = action.payload;
		});
	},
});

export default listSlice.reducer;

import { RootState } from "./store";

export const selectPokemonList = (state: RootState) => state.list.results;
export const selectSelectedPokemon = (state: RootState) =>
	state.details.selected;

import { configureStore } from "@reduxjs/toolkit";
import details from "./detailsSlice";
import list from "./listSlice";

export const store = configureStore({
	reducer: {
		details,
		list,
	},
});

export type RootState = ReturnType<typeof store.getState>;
export type AppDispatch = typeof store.dispatch;

export enum PokemonType {
	NORMAL = "Normal",
	FIRE = "Fire",
	WATER = "Water",
	ELECTRIC = "Electric",
	GRASS = "Grass",
	ICE = "Ice",
	FIGHTING = "Fighting",
	POISON = "Poison",
	GROUND = "Ground",
	FLYING = "Flying",
	PSYCHIC = "Psychic",
	BUG = "Bug",
	ROCK = "Rock",
	GHOST = "Ghost",
	DRAGON = "Dragon",
	DARK = "Dark",
	STEEL = "Steel",
	FAIRY = "Fairy",
}

export interface PokemonStats {
	readonly hp: number;
	readonly attack: string;
	readonly defense: string;
	readonly spattack: string;
	readonly spdefense: string;
	readonly speed: number;
}

export interface PokemonMove {
	readonly learnedat: string;
	readonly name: string;
}

export interface PokemonMoves {
	readonly level: PokemonMove[];
}

export interface PokemonDamages {
	readonly normal: string;
	readonly fire: string;
	readonly water: string;
	readonly electric: string;
	readonly grass: string;
	readonly ice: string;
	readonly fight: string;
	readonly poison: string;
	readonly ground: string;
	readonly flying: string;
	readonly psychic: string;
	readonly bug: string;
	readonly rock: string;
	readonly ghost: string;
	readonly dragon: string;
	readonly dark: string;
	readonly steel: string;
}

export interface PokemonAbilities {
	readonly normal: string[];
	readonly hidden: string[];
}

export interface PokemonMisc {
	readonly abilities: PokemonAbilities;
	readonly classification: string;
	readonly height: string;
	readonly weight: string;
}

export interface Pokemon {
	readonly id: number;
	readonly name: string;
	readonly img: string;
	nickname: string;
	readonly moves: PokemonMoves;
	readonly damages: PokemonDamages;
	readonly stats: PokemonStats;
	readonly misc: PokemonMisc;
	readonly type: PokemonType[];
}
